description:
This is the untold story of one of the biggest Zeppelins ever built: the USS Macon.

Originally built in the early 1930s by German engineers, the Macon carried five Sparrowhawk planes inside her hull that could be launched and retrieved during flight.

The Macon was 785 feet long. The wreck site of the Macon was finally discovered in 1990, 55 years after it sank to the bottom of the Pacific Ocean off the coast of California. A fisherman who had marked the exact coordinates where he'd lost a net assisted the Monterey Bay Aquarium and the Navy with locating the site...

History Documentary hosted by Greg Stebner, published by Discovery Channel, National Geographic in 2008 - English narration

